import React from "react";
import Header from "./Components/Header";
import Image from "./Components/Image";
import logo from "./img/logo.png";

class App extends React.Component {
  constructor() {
    super(props);
  }

  helpText = "help me";
  render() {
    return (
      <div className="name">
        <Header title="look at me" name="opps" />
        <Header title="look at her" />
        <Header title="look at him" />
        <h1>{this.helpText}</h1>
        <input
          placeholder={this.helpText}
          onClick={this.inputClick}
          onMouseEnter={this.mouseOver}
        />
        <p>{this.helpText === "help me" ? "ok" : "no"}</p>

        <img src={logo} className="ttt" />
      </div>
    );
  }

  inputClick() {
    this.helpText = "changed";
    console.log("clicked");
  }
  mouseOver() {
    console.log("over mouse");
  }
}

export default App;
